- input: "TEXT\x1CC00005561\x1CX0\x1C\x1CF3XA\x1CThe Committee is in receipt of your
    letter dated  June 9, 2010 and offers the following response.1.In reference to
    letter received regarding MEMO entries, the committee has amended the report so
    that disbursements to Anne Morgan and Sprint Local Division show as Joint transactions
    instead of pure Federal. The memos now correspond with the original disbursements.2.In
    reference to the letter received regarding reimbursements to individuals, the
    committee has amended the report so that the items for ?Kyle Schulberg: Staff
    Reimbursement? show as Joint disbursements. All memos now correspond with the
    original disbursement.  3.In reference to the letter received regarding the clarification
    of the description for Dr. Milton Clement, the report has been amended to reflect
    that the disbursement was made for Dental Care.  4.In regards to the letter received
    referring to voided or returned checks the report was amended to  incorporate
    the following memos:   Melissa Lamkay: Check issued in error.  Melissa Lamkay:
    Duplicate payment- paid on 10/30/06.  Karen Thurman: Check issued in error.    ........Transfers
    received from the DNC, DCCC, DSCC and candidate committees, not including ASDC/Dollars
    for Democrats and DNC Victory Fund, were not for joint fundraising.  None of the
    transfer in money received from the DNC or DCCC was used in the payments made
    for exempt activities.  None of the expenses listed on Line 21b were public communications
    or FEA activities.  None of the expenditures listed on Line 30b were expressed
    advocacy.  The payments listed on H4, including all consulting fees, were administrative/committee
    fundraising expenses and not FEA nor in connection with a federal election.  Payroll
    and all related expenses reported on Schedule H4 were for staff that did not spend
    more than 25% of their time on FEA or in connection with a federal election.    \n"
